    title: "Tandoori Chicken",
    price: 250,
    ratings: 4.6,
    desc: "Marinated chicken cooked in a clay oven (tandoor) for smoky flavor.",
    img: "tandoori-chicken"
  },
  {
    title: "Palak Paneer",
    price: 220,
    ratings: 4.5,
    desc: "Creamy spinach and paneer curry, rich in flavors.",
    img: "palak-paneer"
  },
  {
    title: "Samosa",
    price: 20,
    ratings: 4.3,
    desc: "Deep-fried pastry filled with spiced potatoes and peas.",
    img: "samosa"
  },
  {
    title: "Rogan Josh",
    price: 320,
    ratings: 4.7,
    desc: "Flavorful Kashmiri lamb curry with aromatic spices.",
    img: "curry"
  },
  {
    title: "Gulab Jamun",
    price: 60,
    ratings: 4.8,
    desc: "Sweet, deep-fried milk dumplings soaked in sugar syrup.",
    img: "sweets"
  }
];
function App() {
  return (
    <>

      <div className="container">
        {
          foodItems.map((item)=>{
           return <Food title={item[0].title} img={foodItems[0].img} ratings="3.9" />
          })
        }


      </div>


    </>
  );
}

export default App;
